#include "leetc.h"
#include <stack>

using std::vector;
using std::string;
using std::printf;
using std::stack;

class Solution {
    public:
        void reorderList(ListNode *head) {
            fast_reorderList(head);
        }
    private:
        void fast_reorderList(ListNode *head) {
            if(head == NULL || head->next == NULL)
                return;
            stack<ListNode *> lnstack;
            fill_queue_with_list(lnstack, head);
            ListNode *pp = head;
            ListNode *p = head->next;
            ListNode *tail = lnstack.top();
            lnstack.pop();
            while(true) {
                pp->next = tail;
                tail->next = p;
                pp = p;
                p = pp->next;
                if(p == tail) {
                    pp->next = NULL;
                    break;
                }
                tail = lnstack.top();
                if(tail == p) {
                    p->next = NULL;
                    break;
                }
                lnstack.pop();
            }

        }
        void fill_queue_with_list(stack<ListNode *> &q, ListNode *head) {
            while(head != NULL) {
                q.push(head);
                head = head->next;
            }
        }
        void bf_reorderList(ListNode *head) {
            if(head == NULL || head->next == NULL)
                return;
            ListNode *pp = head;
            ListNode *p  = head->next;
            ListNode *sp = p->next;
            while((sp = get_tail(p, sp)) != NULL) {
                pp->next = sp;
                pp = p;
                sp->next = p;
                p = pp->next;
                sp = p == NULL ? NULL : p->next;
            }
        }
        ListNode *get_tail(ListNode *phead, ListNode *head) {
            ListNode *ptail = phead;
            ListNode *tail = head;
            while(tail != NULL && tail->next != NULL) {
                ptail = tail;
                tail = tail->next;
            }
            if(ptail != NULL)
                ptail->next = NULL;
            return tail;
        }
};

